def Normalization(Matrix):
    max_len = 0
    for v in Matrix:
        max_len = max(max_len, len(v))
    for v in Matrix:
        while len(v) < max_len:
            value = v[0]
            v.insert(0, value)
    return Matrix


def draw_convergence(LIEM_obj, LIMD_obj, LINC_obj, Normal_obj, Proposal_obj, x_LIEM, x_LIMD, x_LINC, x_Normal, x_Proposal
                     , f, p_value, move, FEs):

    plt.rcParams['font.sans-serif'] = ['SimHei']
    plt.rcParams['axes.unicode_minus'] = False

    plt.semilogy(x_LIEM, LIEM_obj, label='LIEM', linestyle=':')
    plt.semilogy(x_LIMD, LIMD_obj, label='LIMD', linestyle=':')
    plt.semilogy(x_LINC, LINC_obj, label='LINC', linestyle=':')
    plt.semilogy(x_Normal, Normal_obj, label='Normal', linestyle=':', color='cyan')
    plt.semilogy(x_Proposal, Proposal_obj, label='Proposal', color='red')

    # plt.plot(x_LIEM, LIEM_obj, label='LIEM', linestyle=':')
    # plt.plot(x_LIMD, LIMD_obj, label='LIMD', linestyle=':')
    # plt.plot(x_LINC, LINC_obj, label='LINC', linestyle=':')
    # plt.plot(x_Normal, Normal_obj, label='Normal', linestyle=':', color='cyan')
    # plt.plot(x_Proposal, Proposal_obj, label='Proposal', color='red')
    font_title = {'size': 18}
    font = {'size': 16}
    plt.title('$f_' + '{' + str(f) + '}$ in GTOPX Suite', font_title)
    plt.xlabel('Fitness evaluation times', font)
    plt.ylabel('Fitness', font)
    plt.legend()
    if p_value < 0.05:
        if p_value < 0.01:
            plt.text(FEs, move, "**", fontdict={'size': 14, 'color': 'red'})
        else:
            plt.text(FEs, move, "*", fontdict={'size': 14, 'color': 'red'})
    plt.savefig(
       '/Users/ISDL/PycharmProjects/GTOPX/data/pic/' + 'f' + str(f))
    plt.show()


def ave(array):
    result = []
    for i in range(len(array[0])):
        result.append(np.mean(array[:, i]))
    return result


def final(LIEM_obj, LIMD_obj, LINC_obj, Normal_obj, Proposal_obj):
    LIEM_final = LIEM_obj[:, len(LIEM_obj[0]) - 1]
    LIMD_final = LIMD_obj[:, len(LIMD_obj[0]) - 1]
    LINC_final = LINC_obj[:, len(LINC_obj[0]) - 1]
    Normal_final = Normal_obj[:, len(Normal_obj[0]) - 1]
    Proposal_final = Proposal_obj[:, len(Proposal_obj[0])-1]
    print('LIEM final: ', '%e' % np.mean(LIEM_final), '±', '%e' % np.std(LIEM_final, ddof=1))
    print('LIMD final: ', '%e' % np.mean(LIMD_final), '±', '%e' % np.std(LIMD_final, ddof=1))
    print('LINC final: ', '%e' % np.mean(LINC_final), '±', '%e' % np.std(LINC_final, ddof=1))
    print('Normal final: ', '%e' % np.mean(Normal_final), '±', '%e' % np.std(Normal_final, ddof=1))
    print('Proposal final: ', '%e' % np.mean(Proposal_final), '±', '%e' % np.std(Proposal_final, ddof=1))
    return LIEM_final, LIMD_final, LINC_final, Normal_final, Proposal_final


def Holm(LIEM_obj, LIMD_obj, LINC_obj, Normal_obj, Proposal_obj, test):
    result = {'LIEM_LIMD': test(LIEM_obj, LIMD_obj)[1],
              'LIEM_LINC': test(LIEM_obj, LINC_obj)[1],
              'LIEM_Normal': test(LIEM_obj, Normal_obj)[1],
              'LIEM_Proposal': test(LIEM_obj, Proposal_obj)[1],
              'LIMD_LINC': test(LIMD_obj, LINC_obj)[1],
              'LIMD_Normal': test(LIMD_obj, Normal_obj)[1],
              'LIMD_Proposal': test(LIMD_obj, Proposal_obj)[1],
              'LINC_Normal': test(Normal_obj, LINC_obj)[1],
              'LINC_Proposal': test(LINC_obj, Proposal_obj)[1],
              'Normal_Proposal': test(Normal_obj, Proposal_obj)[1]}
    result = dict(sorted(result.items(), key=lambda d: d[1]))
    flag = len(result)
    for (k, v) in result.items():
        result[k] = v * flag
        flag -= 1
    return result


def increase(ave):
    for i in range(len(ave)-1):
        if ave[i+1] > ave[i]:
            ave[i+1] = ave[i]
    return ave


